(window.webpackJsonp=window.webpackJsonp||[]).push([["chunk-2d0d0b8b"],{"68d7":function(n,t,e){"use strict";t.a=[{v:"2.20",time:"2021-3-14",content:"###### 新增功能\n+ 新增**御魂分拣**功能，可用于找出值得强化和应该弃置的御魂，详情可查看我发布的B站视频。\n\n###### 优化\n+ 优化若干问题、补上若干式神数据。\n"},{v:"2.19",time:"2020-12-14",silent:!0,content:"###### 新增数据\n+ 新增SP式神**初翎山风**的数据。\n###### 优化\n+ 【一速分析室】优化御魂信息看不全的问题，优化了若干使用细节。\n+ 【奉纳】优化御魂总数和未穿未锁御魂数的显示。\n"},{v:"2.18",time:"2020-11-29",silent:!0,content:"###### 新增功能\n+ 分析页面新增：**提速日程表**，大致分析一速提升记录，仅供娱乐。\n+ 分析页面新增：**玄学出货表**，大致分析出货时间，仅供娱乐。\n"},{v:"2.17",time:"2020-10-30",content:"###### 新增功能\n+ 分析页面新增：**一速分析室**，直观方便搭配一速御魂，让速度收益最大化！\n"},{v:"2.16",time:"2020-10-21",silent:!0,content:"###### 新增数据\n+ 新增SSR式神**千姬**的数据。\n"},{v:"2.15",time:"2020-10-15",content:"###### 新增功能\n+ 新增分析图表：**全年肝力分布图**，根据御魂入手时间生成全年御魂掉落分布情况。\n    - 可切换年份显示，从2016年到今年；\n    - 可切换统计范围，默认是统计全部六星御魂，可切换只统计15级御魂。\n"},{v:"2.14",time:"2020-09-22",content:"###### 兼容优化\n+ 支持新版御魂导出器格式，新版御魂导出器在2020年9月22日发布的4.0正式版，支持导出更多御魂数据以及游戏方案，因此可以用于御魂Hub的奉纳和游戏方案导入等功能。\n\n###### 新增数据\n+ 新增SP式神**待宵姑获鸟**和**麓铭大岳丸**的数据。\n"},{v:"2.13",time:"2020-08-24",content:'###### 新增功能\n+ 【计算】中新增**极速计算**按钮，通过只计算面板最高的一条记录优化计算速度，使计算速度获得成倍提升。\n    - "极速计算"按钮在计算条件适合的时候会自动出现，可通过旁边的下拉按钮切换回之前的常规计算；\n    - "极速计算"只适合计算没有设置限制属性上限的计算场景，其他计算场景下极速计算按钮会消失，变回常规计算。\n+ 【计算指标】中新增**数学期望**，计算公式为：攻击 x 爆伤 x 暴击 + 攻击 x ( 1 - 暴击) [若暴击大于100%，则为100%]。\n\n###### 功能优化\n+ 优化常规计算下的计算速度，增加更多有效的剪枝处理和减少不必要的计算逻辑，计算速度较之前提高约80%。\n    - 以我自己的御魂数据为例，优化前计算魂十超星破荒茨木大约需要250秒，优化后只需要50秒左右。\n'},{v:"2.12",time:"2020-08-07",content:"###### 新增功能\n+ 【计算】中新增**额外加成**选项卡片，默认值为最近一次活动属性加成。\n+ 【计算结果】中新增**穿戴预览**界面，可以预览当前结果套装穿戴到式神身上之后的各项数值，与游戏内式神属性界面基本一致。\n\n"},{v:"2.11",time:"2020-08-02",content:"###### 新增功能\n+ 【计算】中其他设置里，新增“**暴击溢出时，将溢出暴击按1:1转换为暴击伤害**”勾选项，适用于判官或者一些活动所带的类似Buff，默认关闭，有需要请自行开启。\n\n###### 新增数据\n+ 新增SSR式神**紧那罗**的数据。\n\n"},{v:"2.10",time:"2020-06-26",content:"###### 新增功能\n+ 【奉纳】中支持把某一个御魂的有效属性和御魂规则直接应用到其他多个御魂，以方便同类御魂操作。\n\n###### 新增数据\n+ 新增SP式神**缚骨清姬**的数据。\n\n"},{v:"2.9",time:"2020-06-05",content:"###### 新增功能\n+ 【收藏信息】**御魂卡片中增加当前御魂已被收藏于哪些收藏套装中的提示信息**，在卡片中有红色的星星图标，鼠标移到上面即可显示。\n+ 【奉纳】中仿真界面的**自动滚动速度支持调节**，默认是0最快，数字越高滚动越慢，最慢可设100。\n\n###### 新增特性\n+ 【御魂】**御魂副属性顺序现在可以正确显示**，将与游戏中对应御魂的副属性排列顺序完全一致，更加方便玩家查找对应御魂。\n  - 这个特性**只支持痒痒熊快照**导入的御魂集，因为只有痒痒熊快照导出的数据才有排序信息，御魂导出器是没有的；\n  - 如果本来就是用的痒痒熊快照导入，但是发现副属性排序还是不对的，需要重新更新一下御魂数据（不需要重新从游戏中导出）；\n+ 【检测】在点击开始计算后增加数据检测，如果发现御魂数据中不包含鬼灵歌伎的御魂，那很大可能是因为用的御魂导出器3.10以前的版本，将会进行弹窗提示升级御魂导出工具。\n\n###### 新增数据\n+ 新增SSR式神**铃鹿御前**和SR式神**蝎女**的数据。\n\n###### 数据修复\n+ 【面板修正】鬼使黑觉醒后增加10%攻击加成，之前~~因为太冷门~~被遗漏了。\n\n"},{v:"2.8",time:"2020-05-10",content:'###### 新增功能\n+ 【计算】中增加**排除御魂**功能，用于某些情况下快捷排除单/多个御魂。不过建议一般情况下，还是使用排除套装的方式去进行御魂排除会更加合理和方便。\n+ 【计算结果】中增加**总分**列，即：套装有效总分/套装理论满分，普通御魂满分为9分，首领御魂为12分（不考虑防御加成的16分特殊情况。\n+ 【奉纳】中的御魂卡片右上角下拉菜单中增加按钮"**跳转到下一个选中御魂**"，当一些选中御魂之间间隔较长时，不再需要手动滚动和担心看漏。\n\n###### 新增数据\n+ 奉纳功能新增规则：生命胚子\n  - 适用场景：追求极限生命不考虑其他的场景，比如纯生命书翁；\n  - 默认不勾选，有需要的玩家可以自行启用。\n+ 奉纳功能新增规则：攻击胚子\n  - 适用场景：追求极限攻击不考虑其他的场景，比如大舅工具人；\n  - 默认不勾选，有需要的玩家可以自行启用。\n\n###### 问题修复\n+ 修复已经点击过应用规则，关闭某种御魂的规则之后，该类御魂的保留弃置状态还存在的问题。\n\n'},{v:"2.7.2",time:"2020-05-07",content:"###### 新增数据\n+ 奉纳功能新增规则：三腿暴击胚子、三腿速度胚子、三腿命中胚子、三腿抵抗胚子\n  - 适用场景：暴击/速度/命中/抵抗胚子的低练度可选版本；\n  - 默认不勾选，有需要的玩家可以自行启用。\n+ 奉纳功能新增规则：生命暴击胚子、三腿生命暴击胚子（前者的低练度推荐版本）\n  - 规则说明：初始 4 条腿，且有 1 条为暴击的胚子；位置得是二四六号位之一，主属性得是生命加成；\n  - 适用场景：需要暴击但是有效属性不希望加入生命加成，如暴击二件套类御魂，可用在奶盾等式神上；\n  - 默认勾选生命暴击胚子，不需要的玩家可以自行关闭。\n+ 奉纳功能新增规则：四号命抗双堆、三腿四号命抗双堆（前者的低练度推荐版本）\n  - 规则说明：必须是四号位，初始 4 条腿，且有 1 条为效果命中或效果抵抗的胚子，主属性是效果命中或效果抵抗；如果是首领御魂，固定属性得是效果命中或效果抵抗；\n  - 适用场景：可用于斗技需要命抗双堆的情况；\n  - 默认勾选四号命抗双堆，不需要的玩家可以自行关闭。\n+ 奉纳功能新增规则：瘸腿首领命中胚子、瘸腿首领抵抗胚子\n  - 规则说明：初始不满 4 条腿，且有 1 条腿和固定属性都是效果命中/效果抵抗的首领御魂胚子；如果是四号位，则要求主属性也为效果命中/效果抵抗。\n  - 适用场景：可用于斗技散件命中或抵抗的首领御魂；\n  - 默认勾选，不需要的玩家可以自行关闭。\n\n###### 体验优化\n+ 优化规则导入和导出按钮点击有效区域过小，导致有时候点击误以为没反应的问题。\n\n###### 问题修复\n+ 修复已经点击过应用规则，关闭某种御魂的规则之后，该类御魂的保留弃置状态还存在的问题。\n\n"},{v:"2.7.1",time:"2020-05-05",content:"###### 新增数据\n+ 奉纳功能新增规则：三腿暴击胚子、三腿速度胚子、三腿命中胚子、三腿抵抗胚子\n  - 适用场景：暴击/速度/命中/抵抗胚子的低练度可选版本；\n  - 默认不勾选，有需要的玩家可以自行启用。\n+ 奉纳功能新增规则：生命暴击胚子、三腿生命暴击胚子（前者的低练度推荐版本）\n  - 规则说明：初始 4 条腿，且有 1 条为暴击的胚子；位置得是二四六号位之一，主属性得是生命加成；\n  - 适用场景：需要暴击但是有效属性不希望加入生命加成，如暴击二件套类御魂，可用在奶盾等式神上；\n  - 默认勾选生命暴击胚子，不需要的玩家可以自行关闭。\n+ 奉纳功能新增规则：四号命抗双堆、三腿四号命抗双堆（前者的低练度推荐版本）\n  - 规则说明：必须是四号位，初始 4 条腿，且有 1 条为效果命中或效果抵抗的胚子，主属性是效果命中或效果抵抗；如果是首领御魂，固定属性得是效果命中或效果抵抗；\n  - 适用场景：可用于斗技需要命抗双堆的情况；\n  - 默认勾选四号命抗双堆，不需要的玩家可以自行关闭。\n+ 奉纳功能新增规则：瘸腿首领命中胚子、瘸腿首领抵抗胚子\n  - 规则说明：初始不满 4 条腿，且有 1 条腿和固定属性都是效果命中/效果抵抗的首领御魂胚子；如果是四号位，则要求主属性也为效果命中/效果抵抗。\n  - 适用场景：可用于斗技散件命中或抵抗的首领御魂；\n  - 默认勾选，不需要的玩家可以自行关闭。\n\n###### 体验优化\n+ 优化规则导入和导出按钮点击有效区域过小，导致有时候点击误以为没反应的问题。\n\n"},{v:"2.7",time:"2020-05-03",content:"###### 新增功能\n+ 新增用户注册登录功能，主要用于数据云同步，如无云同步的需要可以不注册登录，现有功能照常使用；\n+ 新增数据云同步功能，出于服务器成本考虑，仅对部分用户开放：\n  - 御魂Hub微信公众号从即日起接受玩家或主播投稿，题材包括但不限于攻略、视频、故事、漫画、心得、表情包等，阴阳师或御魂Hub相关即可，要求原创，或者是任何你觉得可以在御魂Hub发表的内容。一经采用，则视内容质量赠送相应数据云同步时长，欢迎大家踊跃投稿；\n  - 如无可投稿内容，也可以通过自己承担部分服务器费用的方式获取该功能；\n  - 可通过微博@高冷少年w 或注册之后显示的微信二维码联系我协商相关事宜；\n+ 奉纳功能新增 3 个小功能，在每个御魂卡片的右上角下拉（感谢大佬@YYSKernel 的建议）：\n  - 可以对某个御魂进行锁定，与游戏内锁定行为一致，用于锁定一些觉得有必要保留但暂时没有保留规则能描述出来的御魂；\n  - 可以指定从某个御魂开始选中一百个建议弃置的御魂，用于一些情况下可以比较方便地对某一批御魂进行处理。\n  - 对御魂列表增加行号，并且在点击选中100个弃置御魂按钮后，在下方提示第一个选中的御魂在第几行。（本来打算做一个直接跳转按钮，不过所使用的第三方依赖库跳转功能有bug，等那边修复后再更新实现）\n\n###### 新增数据\n+ 奉纳功能新增三条规则：满条双爆、三条双爆、两条双爆。（感谢大佬@YYSKernel 的建议）\n  - 适用场景：需要暴击爆伤但是主属性不一定限制在输出类，如破势、针女、蚌精等，可用在书翁等式神上；\n  - 默认不勾选，有需要的玩家可以自行启用。\n+ 奉纳功能新增两条规则：首领命中胚子、首领抵抗胚子。\n  - 规则说明：初始 3 或 4 条腿，且有 1 条腿和固定属性都是效果命中/效果抵抗的首领御魂胚子；如果是四号位，则要求主属性也为效果命中/效果抵抗。；\n  - 适用场景：首领御魂因为固定属性的原因很适合用来做命中或抵抗两件套或单件，适用于斗技；\n  - 默认勾选，不需要的玩家可以自行关闭。\n"},{v:"2.6",time:"2020-05-02",content:'###### 新增功能\n+ 新增"奉纳"功能，用于辅助弃置御魂，请参考使用使用说明后使用。\n  - 稍后我会制作视频教程在B站上传，不想看文字说明的朋友可以再等等。\n\n###### 新增数据\n+ 新增SP式神**浮世青行灯**和SR式神**风狸**的数据。\n+ 新增公共预设斗技分类下的**不包邮斗技**相关式神预设，数据由大佬@不包邮哦亲 提供。\n\n###### 体验优化\n+ 御魂数据卡片优化样式，非有效属性颜色将变浅，每种御魂有自己的代表色方便辨认。（已提前上线）\n+ "我的预设"与"排除套装"中的数据支持同级之间拖动调整顺序。（已提前上线）\n'},{v:"2.5",time:"2020-03-09",content:"###### 新增数据\n+ 新增SSR式神**缘结神**的数据。\n\n###### 新增功能\n+ 新增计算指标**日轮鬼吞增伤**，用于日轮副本中使用鬼吞铁鼠增伤计算。\n    - 感谢**@微小神迹**大佬的代码支持与技术支持，请配合他的攻略使用此指标！\n    - 日轮副本计算的相关公共预设，微小神迹大佬提供后我会尽快更新上来，请耐心等候。\n"},{v:"2.4",time:"2020-01-22",content:"###### 新增数据\n+ 新增SSR式神鬼童丸和SP式神聆海金鱼姬的数据。\n\n###### 问题修复\n+ 修复在排除某个位置之后计算可能出错的问题。（感谢@鸟巢 反馈）\n+ 修复勾选了计算荒骷髅1.1倍伤害加成，但是云外镜阴面伤害没生效的问题。（感谢@YYSKernel 反馈）\n"},{v:"2.3",time:"2019-12-26",content:'###### 新增功能\n+ 新增计算指标**云外镜阴面伤害**，感谢@微小神迹 大佬提供概念、算法和代码多方面的支持。\n  - 伤害计算公式为：（攻击 + 防御 x 2) x 爆伤。\n  - 当选择该指标时，会显示额外的功能选项**魂土献祭流体质过滤**，用于过滤云外镜在魂土献祭流中的体质要求。\n  - 当选择该指标时，计算结果将会显示额外的一列**体质评分**，用于判断是否适用于魂土相关套路。\n\n+ 计算结果**增加是否已收藏的信息显示**，已收藏的结果"收藏"按钮将变为"已收藏"，且颜色做了区分。展开计算结果除了查看御魂信息之外，还可以查看当前结果已收藏到具体哪几个位置。\n\n+ 新增**指定御魂**功能，可在御魂范围选项中指定某个位置固定为某个御魂。\n  - 这个功能也是很多人提过希望出的，一开始我的想法是在计算极端面板的情况下似乎没有必要，因为高收益御魂不一定在面板最高的套装里。不过后来考虑到我的想法不一定全面，说不定有想法的人能玩出花儿来，而御魂Hub应该能提供一定的自由度，因此加上了这个功能。\n'},{v:"2.2",time:"2019-12-23",content:"###### 新增数据\n+ 新增SSR式神**云外镜**的面板数据，并根据目前已有的攻略，设置了推荐御魂套装：破势鬼灵歌伎、招财猫。\n\n###### 体验优化\n+ 线程数应高配置玩家要求提高到24上限，请根据自己机器情况酌情使用。\n+ 将页面右上角几个信息块改为下拉显示，减少不必要的信息干扰。\n\n###### 问题修复\n+ 修复了在收藏页面对收藏列表按照某列进行排序时不生效的问题。（感谢群友@樱花气刃斩 反馈）\n+ 修复了导入游戏方案界面，对游戏方案列表进行关键字筛选后，点击全选选中的是全部游戏方案而不是关键字匹配的游戏方案的问题。（感谢泥潭坛友@DeadPoolYYY 反馈）\n+ 修复了在计算山风御魂时，如果结果套装不加一点暴击时，在代入式神数据的情况下显示暴击为100%的问题。（感谢群友@与光同在与你同行 反馈）\n"},{v:"2.1",time:"2019-12-15",content:'###### 新增数据\n+ 新增~~被遗忘的~~SR式神**纸舞**的面板数据，并根据目前已有的攻略，设置了推荐御魂套装：招财猫。\n\n###### 体验优化\n+ 点击**计算**标签页可以直接跳到计算一套的界面，不需要再在下拉列表中点击"一套"。\n\n###### 问题修复\n+ 修复了更新2.0版本之后新建的部分自定义套装勾选排除之后不生效的问题。\n+ 修复了鼠标移到左侧收藏列表时，弹出的套装详情变为只算御魂分数数值的问题。\n+ 修复了查看御魂集的御魂数据时，翻页查看之后，点击某条御魂的查看按钮显示的数据不对应的问题。\n'},{v:"2.0",time:"2019-12-10",content:"# 重要！！\n  - 御魂Hub即日起启用**新域名**：**[yuhunhub.tql8.com](https://yuhunhub.tql8.com)**\n  - 访问 **[tql8.com](https://tql8.com)** 或者 **[www.tql8.com](https://www.tql8.com)** 都可以，都会自动跳转到上面的地址。\n  - 新域名由于浏览器限制因此与旧域名数据并不互通，请大人们手动导出收藏与预设，再导入新域名的御魂Hub中。\n  - **旧域名**不再更新御魂Hub，并且将在一两个月后关闭或者做重定向跳转到新域名，请抓紧转移数据并避免使用旧域名。\n  - 如果在一些地方如浏览器的收藏夹中收藏了旧域名，请记得更新为新域名，以免造成使用混乱。\n\n  - 由于新域名的服务器租用的是非大陆服务器，免去了备案的麻烦，但是也导致会因为无备案信息被微信QQ等软件屏蔽打开。如遇这种情况请复制网址到浏览器打开即可。\n\n###### 技术优化\n+ 新的域名下的御魂Hub采用了新的底层存储方式，也**对一设多套的计算进行了大幅度的优化**。现在计算一设多套将不再卡顿与崩溃，且计算速度（尤其是第二阶段）也加快了。\n\n###### 体验优化\n+ 由于发现部分人用了一段时间之后都没发现御魂分数的功能，且默认显示御魂分数似乎更加方便，因此将**默认在结果列表中显示御魂分数**。\n+ 取消对藏宝阁excel文件的导入支持，主要是因为excel文件御魂信息不全，而**痒痒熊主程序也支持导出藏宝阁数据**，并且使用方便信息齐全，推荐使用痒痒熊导出藏宝阁数据。\n+ 御魂**更新导入取消全量增量选项**，导入**默认都设置为全量覆盖导入**。主要是这个增量导入的功能在长久的使用中发现其实没太大必要，而且在开放非满级御魂计算后御魂增删变动更加频繁，并不需要增量导入，因此去除这个选项。\n+ 删除御魂集之后左侧抽屉改为不自动收起，方便连续删除御魂集。\n"},{v:"1.30",time:"2019-11-27",content:'###### 新增功能\n+ 新增**一设多套**计算模式，用于计算同一个计算条件下的多套独立最优阵容，如多鸩、双吞等。\n  - 由于这种模式的计算理论上期望套装数越多计算量越巨大，因此对机器内存有更高要求，配置较低的大人们请谨慎使用；\n  - 目前的计算逻辑还存在优化空间，不过需要改动底层的数据结构。日后我会逐步优化，优化到一定程度再考虑"多设多套"的实现，因为其实都是差不多的实现逻辑；\n  - 建议使用前看下我即将发布的教学视频，应该在本公告发布之后的一两天内发布到B站、公众号、微博等。\n\n###### 新增数据\n+ 新增**天剑韧心鬼切**的面板数据，并根据目前已有的攻略，设置了推荐御魂套装：破势、招财猫、薙魂。\n\n###### 体验优化\n+ 由于之前收藏套装时"是否覆盖原有套装名称"的选项很少人注意到，而该选项默认是不勾选的，因此造成一部分人改了收藏名称之后选择旧收藏覆盖之后发现没生效，以为是bug。因此现在改为如果有修改过收藏名称，则该选项自动勾上。\n+ 优化收藏结果列表的横线滚动体验，不会再出现单个御魂信息被分隔开来的现象。\n'},{v:1.29,time:"2019-11-16",content:'###### 功能优化\n+ 面板指标"童男增伤后面板"中，所使用的童男除了之前可选的"二星未觉醒"和"二星已觉醒"之外，**增加"自定义生命"选项**，方便涂佛童男乃至其他更多情况下童男增伤的计算。\n\n###### 修复问题\n+ 修复在计算套装总加成时，结果套装中若存在3个或5个相同类型御魂时，总加成算少对应两件套带来的加成的问题。在此感谢微博网友@喵车司机 的发现和反馈！\n  - 此bug可能会对单纯限制四件套或限制散件的计算的最优结果产生影响，但对完整指定六个位置御魂的计算没有影响。\n+ 修复排除了某个部位再计算四件套装时，结果列表会出现只有三件套也被认为合格的套装。\n'},{v:1.28,time:"2019-11-07",content:"###### 新增数据\n+ 公共预设-御魂-魂十一 新增阵容预设**18s双烬童薰瑰**(前几天已更新)和**22s玉烬童薰瑰**，感谢@**微小神迹** 大佬的支持。点击阵容标题链接可以跳转查看详细攻略地址，点击作者名称链接可以跳转作者个人主页。由于预设中修改了部分式神面板数据，**强烈建议使用预设时配合攻略对照使用**。\n\n###### 体验优化\n+ 由于之前默认折叠左侧收藏夹的优化，导致很多人以为自己的收藏套装不见了，因此重新改为默认展开，但是**增加一个展开折叠按钮**，点击可以全部展开或全部折叠，并且**记住最近是全部展开还是全部折叠**，在下次打开页面时加载此状态。方便喜欢默认展开或默认折叠的玩家各取所需。\n+ 优化收藏套装时的界面显示，明确是否覆盖原有套装名称。\n"},{v:1.27,time:"2019-11-05",content:"###### 新增功能\n+ 御魂范围中支持**排除一个或多个位置**后进行计算，目前可以用于计算不带五号位的童男或其他可能需要但未预料到的计算场景。默认为不排除任何位置。\n+ 计算指标新增**防御**，配合限定伤害输出范围之后，可以用于计算地鬼等需要高防的场景。\n\n###### 功能改造\n+ **解除御魂套装必须选择至少一个二件套或四件套的限制**。\n  - 考虑到实际情况下即使至少选了一个二件套，其理论计算时间其实也跟没选差不多。\n  - 另外一个考虑是实在太多人问散件一速怎么算了……\n  - **计算散件套装时，强烈建议设置最低御魂分数**！在设置较高的御魂分数限制(如4或5)时，其实计算散件一速还是很快的。\n\n###### 体验优化\n+ 继续**大幅度**优化计算卡顿问题。\n+ 针对**加速设置里的限制最低次数**增加**快捷调整**，可同步修改所有位置的最低次数限制。\n+ 针对**位置指定中的二四六号位**增加**全选**按钮，可快捷选取该位置所有主属性。\n"},{v:1.26,time:"2019-11-03",content:'###### 新增功能\n+ 新增**式神推荐御魂**功能，当选择式神之后，在选择御魂套装按钮后将会出现推荐御魂。\n  - 鼠标**点击该推荐御魂会自动应用该御魂**，鼠标**悬浮到推荐御魂上会浮现下拉列表**，提供更多推荐御魂供选择。\n  - 每个式神对应的推荐御魂是全局维护的，目前我只是按自己的理解给大部分式神设置了推荐御魂。**如果你认为某个式神的推荐御魂有问题或者是想新增一些推荐御魂，可以通过微信公众号、微博、B站、QQ群等方式联系我，希望大家踊跃来维护，感谢**！\n\n###### 体验优化\n+ 优化当收藏方案过多时导致的操作和计算卡顿的问题，并限制收藏方案(排除套装)的最大长度，超过长度将出现滚动条。【前几天已更新】\n\n###### 问题修复\n+ 修复编辑界面选择新指标"童男增伤后面板"不生效的问题。\n'},{v:1.25,time:"2019-10-31",content:"###### 新增功能\n+ 增加新计算指标**童男增伤后面板**，用于计算魂土童男+SP酒吞套路的输出面板，感谢@微小神迹 大佬的联动与理论支持。\n\n###### 问题修复\n+ 修复选择目标式神时，再次选择不同式神之后已选条件和计算结果页面显示的式神名称有误的问题。\n"},{v:"1.24.1",time:"2019-10-30",silent:!0,content:"###### 新增数据\n+ 增加新SP**鬼王酒吞童子**与SR**星熊童子**的面板数据。\n"},{v:1.24,time:"2019-10-27",content:'###### 新增功能\n+ 增加**自定义御魂范围**，可手动指定参与计算的御魂的星级和等级，支持统一指定所有位置或分位置指定。\n  - 星级只可指定**四到六星**的一个或多个，等级可指定**0级到15级**。\n  - 御魂范围的默认值为四到六星的15级御魂。\n  - **使用此功能需要重新全量导入御魂集**，因为以前非+15的御魂在导入时是过滤掉的。**推荐使用痒痒熊快照**，因为痒痒熊快照默认已经是导出了所有等级的御魂数据，而御魂导出器默认只导出+15的御魂，需要**开启增强模式**才可导出所有御魂数据。而且目前御魂导出器导出的数据缺失主属性信息，会导致非+15御魂在主属性数值显示上出现错误。\n+ 增加计算条件的**历史记录**，现在将会保存最近10条进行过计算的计算条件，点击可重新应用该历史记录的计算条件，位置在计算页面"公共预设"旁边。\n\n###### 体验优化\n+ **已选条件**中的数值改为结合式神面板之后的数值，和默认填写的限制属性一致，避免造成误解。\n+ 计算结果页面的**代入式神数据选项改为默认勾选上**，这样计算条件、已选条件文案、结果数值就可以保持一致，更加符合使用直觉。\n+ 指标范围中的计算"指定范围100条"，默认从**计算出100条符合要求的结果后立即停止**改为**一直计算符合范围的最高100条直到计算完毕**，并增加一个勾选框，勾上即可回到100条结果后立即停止计算的模式。另外在测试过程中发现如果不指定下限，会因为一瞬间符合要求的结果太多造成页面严重卡顿，因此将面板的**下限输入框设为必填**。\n+ 当浏览器存储空间不足时，提示玩家删除重复或多余御魂集，否则会出现无法导入御魂集、无法计算或者无法收藏套装的问题。\n\n###### 问题修复\n+ 修复访问已经导入过御魂集的御魂Hub首页时，默认跳转到最旧御魂集的问题，现在跳转到最新御魂集。\n+ 修复删除当前御魂集之后，默认跳转到最旧御魂集的问题，现在跳转到最新御魂集。\n+ 修复一些属性限制上限填写0时不生效的问题。\n'},{v:1.23,time:"2019-10-22",content:'###### 体验优化\n+ 收藏套装时**支持选择已有方案覆盖**。\n+ 计算页面左侧排除套装列表**优化数值查看功能**，鼠标移到具体收藏项上将显示各个属性数值，方便计算关联套装时查看相关属性如速度等。\n+ 对于通过御魂Hub计算出来并收藏的套装，在**计算页面左侧排除套装列表鼠标移到该收藏项时，显示"应用该计算条件"按钮**，点击可以将该套装的计算条件应用到右侧，方便重新计算套装。对于从游戏方案导入的收藏则无法提供此功能。\n+ 计算结果列表在勾选"代入式神数据"之后，数值前不再显示"+"号。\n+ 收藏套装列表默认改为收起状态，方便收藏夹与收藏方案过多时的操作。\n\n###### 问题修复\n+ 修复在勾选考虑荒骷髅1.1加成的情况下，"属性限制"中的"伤害输出"没有计算1.1加成的问题。\n+ 修复切换预设方案或者重置计算条件时，荒骷髅1.1加成的勾选项没有改变的问题。\n'},{v:1.22,time:"2019-10-09",content:'###### 新增功能\n+ 顶部右侧导航新增"**御魂导出**"，点击可查看当前两款御魂导出工具的特点并下载。\n+ 顶部右侧导航"常见问题"改为"**视频教程**"，点击可查看目前御魂Hub发布于B站的视频教程，后续会更新更多视频教程。\n\n###### 体验优化\n+ 式神面板增加关闭按钮，并且鼠标点击其他位置也会自动关闭式神面板。\n\n###### 问题修复\n+ 修复在计算**自带效果抵抗**的式神(如陆生)时，规定下限的情况下误加多一次式神自身抵抗导致算出来的套装，效果抵抗实际达不到要求的抵抗下限的问题。（感谢群友@A_eve 的反馈）\n+ 修复在计算结果中，代入式神数据后按攻击排序不生效的问题。\n'},{v:"1.21",time:"2019-10-05",silent:!0,content:"###### 问题修复\n+ 修复部分情况下会导致某些符合条件的结果丢失的问题。（感谢NGA论坛网友 @澳门最大的 提出问题并提供数据）\n"},{v:"1.20",time:"2019-10-01",silent:!0,content:"###### 问题修复\n+ 修复导入新御魂集后立刻重命名御魂集会导致新导入御魂集丢失的问题。\n"},{v:1.19,time:"2019-09-20",content:"###### 新增数据\n+ 增加新SSR**泷夜叉姬**与SP**烬天玉藻前**的面板数据；\n+ 部分式神面板数据更新为带小数点的面板数据。\n\n###### 问题修复\n+ 修复部分情况下保存预设有可能影响原有预设的问题。\n"},{v:1.18,time:"2019-09-01",content:'###### 新增功能\n+ 新增其他设置，可勾选"**计算结果中有荒骷髅套装时，输出面板算入荒骷髅1.1倍系数加成**"，默认为不勾选，即不算入1.1倍系数加成。当对照攻略计算面板时，请注意攻略给出的面板是否包含了荒骷髅加成系数，再来设置该项。\n+ 计算指标新增**暴击伤害**，以满足部分玩家在指定部分属性下限的情况下，追求爆伤最大化的需求。\n\n###### 体验优化\n+ 优化**在已导入御魂集的情况下，打开首页导入页面时，自动跳转到第一个御魂集的计算页面**，避免部分玩家从收藏夹打开首页导入页面时，因为看不到御魂集列表以为每次使用都要重新导入数据。\n+ 优化计算界面中**御魂类型排除**的逻辑，改为**指定**的优先级高于**排除**的优先级，以前是反过来的。\n\n###### 问题修复\n+ 修复**收藏页面中代入式神数据可能出现数据不对**的问题，不过已经出现这个问题的玩家，还需要自行在收藏页面点击问题套装的**编辑**按钮，在编辑窗口**将所属式神改回正确的式神**。后面新收藏的套装将不会再出现此问题，抱歉。\n+ 修复**点击我的预设时自定义的式神面板无法应用到右边计算条件里**的问题。\n'},{v:1.17,time:"2019-08-25",content:'###### 新增功能\n+ **我的预设新增导出和导入功能**，在"我的预设"下拉框中。\n\n###### 新增数据\n+ 增加联动新SSR**黑崎一护**与SR**朽木露琪亚**的面板数据。\n\n###### 体验优化\n+ 开始计算之后，**关闭浏览器时会弹出确认窗口**，防止计算中或计算出结果之后误关闭浏览器。\n+ 式神面板查看修改的按钮增加文字提示，避免部分玩家不知道有这个功能。\n'},{v:1.16,time:"2019-08-14",content:'###### 新增功能\n+ 预设方案改造，**允许自定义预设方案**，并且可以以文件夹形式组织存放。原预设方案依旧保留，改成叫公共预设。\n+ 支持**多线程计算**。粗略测试，在相同的限制条件下多线程比原来的单线程至少节省约 60% 的时间。可以在"开始计算"按钮那一行设置计算线程数，初始为 4 线程。\n+ 增加**常用式神**设置。在式神选择框中点击式神名称右侧星星，可以设置为常用式神，方便点击选取。\n+ 限制属性增加**伤害输出**的上下限输入框，计算指标增加**暴击**。这两项配合使用，可以在已知无法满暴的情况下，计算出指定输出面板下最高暴击的方案。适用于一些地鬼、退治等副本的寿命打法，或用于查看暴击短板明确赌魂方向等。\n\n###### 体验优化\n+ 稍微优化了手机端竖屏打开时的显示效果。\n'},{v:1.15,time:"2019-08-10",content:"###### 问题修复\n+ **修复首领御魂中单项属性分达到9分的属性分被识别为0分的bug**，建议大佬们**重新执行一次全覆盖导入**即可修正。感谢同寮大佬 @北航学长 的反馈。\n+ 修复从已删除御魂集链接进入御魂hub时出现的问题，现在会直接跳转到最新御魂集。\n+ 修复御魂集过多时列表无法滚动的问题。\n\n###### 体验优化\n+ 计算页面的排除套装中添加**全选/全不选**勾选框，方便选取所有收藏方案。\n"},{v:1.14,time:"2019-08-05",content:'###### 新增功能\n+ 支持**导入藏宝阁excel文件**，仅支持由 @victor0419 大佬制作的抓取工具导出的excel文件。由于抓取信息不包括御魂星级和等级信息，因此部分非六星+15御魂的主属性显示可能有误，不过不影响计算。\n+ 限制属性界面增加**最终攻击、最终防御、最终生命**的上下限输入框，方便计算"万攻式神"、"压血线小小黑"等场景。\n+ 计算指标增加**双重暴击**的计算，计算方式为"攻击X暴击伤害X暴击伤害"。\n+ 计算结果界面增加**显示御魂分数**勾选框，打开将可以看到每个御魂的**总分数**和**单属性分数**。\n+ 计算结果界面增加**代入式神数据**勾选框，打开将可以**预览式神穿戴御魂之后的最终属性值**。\n+ 计算结果界面增加**显示小数点后2位**勾选框，打开将可以**直接查看所有数值到小数点后2位的精度**，比原有的鼠标移到数值上查看小数点更加方便，原有查看小数点方式仍旧保留。\n\n###### 新增数据\n+ 增加新SP**骁浪荒川之主**与SR**蟹姬**的面板数据。\n\n###### 问题修复\n+ **三尾狐**面板数据中的默认速度改为觉醒后的122。\n\n###### 体验优化\n+ 优化御魂hub界面布局，将御魂集收起在左侧抽屉，点击头部当前御魂集名称可显示；\n+ 优化在收藏夹中点击新建子收藏夹时会勾选当前收藏夹的问题；\n+ 高级设置弹出面板增加重置按钮；\n+ 所有弹出窗口（如计算结果窗口）改为点击阴影区域不会关闭窗口，避免误关闭；\n+ 计算开始之后，将会暂时禁止跳转到页面内其他标签页，防止误操作丢失计算（若确实有查看其他标签页的需要，建议另开浏览器窗口查看）；\n+ 收藏夹增加刷新按钮，当打开多个浏览器页面对同一个御魂集的收藏夹进行操作时，点击可获取最新收藏夹内容。\n'},{v:1.13,time:"2019-07-22",content:"###### 体验优化\n+ 选择式神控件在支持输入中文关键词搜索的基础上，**增加对拼音搜索的支持**。支持全拼、简拼、模糊音、瞎鸡儿拼，例如buzhihuo、bzh、buzihuo、uiu都可以搜到不知火。\n"},{v:"1.12",time:"2019-06-24",silent:!0,content:"###### 新增数据\n+ 修复痒痒熊导入新首领御魂**鬼灵歌伎**数据无效的问题；\n+ 增加新SSR**大岳丸**与SR**久次良**的面板数据。\n"},{v:"1.11",time:"2019-06-14",silent:!0,content:"###### 新增数据\n+ 增加新首领御魂**鬼灵歌伎**数据。\n"},{v:"1.10",time:"2019-06-10",silent:!0,content:"###### 新增数据\n+ 增加新SP**御怨般若**与SR**海忍**面板数据。\n"},{v:"1.9.1",time:"2019-05-10",silent:!0,content:"###### 问题修复\n+ 修复点击重置按钮之后计算一直为0/0的问题。（感谢@Ocal 反馈）\n"},{v:1.9,time:"2019-05-04",content:'###### 新增功能\n+ 支持**设置有效属性**并**限制最低加成次数**，用于提高计算速度，在御魂计算界面的**高级设置**中设置。\n  > 需要全量导入御魂数据以便对数据进行预处理，之前1.8升级后已执行过全量导入的不需要再执行一次。\n\n  > **判断是否需要执行全量导入的方法**：进入"御魂数据"Tab页，勾选"显示有效属性次数"，如表格内容有动态显示加成次数，则不需要再全量导入；反之则需要。'},{v:"1.8.2",time:"2019-04-28",silent:!0,content:"###### 问题修复\n+ 修复同一个浏览器开多个页面处理不同御魂集时可能导致数据混乱的问题。\n"},{v:"1.8.1",time:"2019-04-27",silent:!0,content:"###### 问题修复\n+ 修复在某些限制条件下页面卡死的问题。\n"},{v:1.8,time:"2019-04-26",content:"###### 新增功能\n+ 新增**导入游戏方案**功能，在**我的收藏**页面，支持导入**痒痒熊**数据文件，并提取其中的游戏方案数据。\n+ 增量导入Tab页增加**全量覆盖更新**选项，用于全量数据更新。\n\n###### 新增数据\n+ 增加新SSR**不知火**面板数据。\n+ 增加四个新御魂：**青女房、涂佛、兵主部、飞缘魔**。\n\n###### 体验优化\n+ 优化御魂卡片显示，并将**首领御魂的固有属性提取显示**。\n  > 需使用全量覆盖更新功能，重新导入全量数据，且json数据文件需由**痒痒熊**或**御魂导出器3.8**及以上版本导出。\n+ 优化御魂数据显示，并增加**显示有效属性次数**的开关。\n  > 也是需要在重新全量导入数据之后才会显示。\n"},{v:"1.7.1",time:"2019-04-24",silent:!0,content:"###### 体验优化\n+ 优化计算开始时某些情况下容易导致页面卡顿甚至卡死的问题。\n"},{v:1.7,time:"2019-04-23",content:"###### 新增功能\n+ **新增御魂套装排除功能**，用于计算散件时提高计算速度。\n\n+ **新增自定义套装编辑功能**，用于手动更新套装信息（如提速后修改一速套装等）。\n\n+ **新增常见问题页面**，从NGA迁移过来。\n\n###### 体验优化\n+ 计算结果列表增加了展开提示，并且在计算完毕后自动展开第一个结果。\n\n###### 问题修复\n+ 修复计算结果页面分页页数大于1时倒序排列以及点击列排序只排序当前页面数据的问题。\n\n"},{v:1.6,time:"2019-04-14",content:'###### 新增功能\n+ **新增自定义收藏套装功能**。\n\n  入口在"我的收藏"Tab页中，点击"新建自定义套装"，填写相关值，即可以创建自定义套装，用于御魂计算时排除御魂。\n\n###### 体验优化\n+ 御魂计算指标范围中"指定范围"的选择改为"指定范围100条"，**当符合指标范围的数据超过100条时，计算会自动停止**。\n  这样做是考虑到指定范围内的数据过多时，会造成界面卡顿以及占据大量内存。而且实际使用中也用不到超过100条的结果数据。\n\n+ 计算结果列表增加了分页显示。\n\n###### 问题修复\n+ 修复限制属性栏中各项属性值有可能出现联动错误的问题。\n\n'},{v:1.5,time:"2019-04-11",content:"###### 新增功能\n+ 限制属性改成两种填值模式：**结合式神面板**和**单纯御魂限制**。\n\n  后者就是之前版本的模式，前者可以让我们**在填写限制值时按照御魂数值+式神面板之后的值填写**。如需要满暴则暴击下限直接填写100即可。\n\n  结合式神面板填写更加人性化以及不需要自己再去做一些加减计算，因此默认以此种方式填写限制属性；\n\n###### 数据优化\n+ **部分式神基础面板数据追加上觉醒后增加的值**，包括：阎魔基础速度从117改为127，荒川之主暴击从10%改为20%，陆生效果抵抗从0改为50%，数珠效果抵抗从0改为25%。\n\n+ **部分式神基础面板数据在计算前追加上觉醒后增加的加成值**，包括：大天狗算攻击面板之前先增加10%加成，桃花妖在算生命面板之前先增加10%加成。若针对这两个式神的未觉醒面板计算，可在式神数据面板中去除这两个加成。\n\n###### 问题修复\n+ 修复**增量导入**时部分浏览器依然会提示导入文件非Json文件的问题；\n\n+ 修复计算结果御魂类型有可能不符合御魂限制中二件套要求的问题；\n\n+ 御魂数据Tab页中的御魂类型过滤中增加首领御魂的过滤；\n\n+ 优化御魂计算页面布局。\n\n"},{v:1.4,time:"2019-04-05",content:"###### 新增数据\n+ 增加 SR 式神化鲸的数据。\n\n###### 体验优化\n+ **收藏夹目录树支持拖拽改变层级**。\n\n###### 问题修复\n+ 修复计算结果页面部分主属性鼠标查看小数点会显示如55.00000000001的问题；\n\n"},{v:1.3,time:"2019-04-03",content:"###### 新增功能\n+ **支持导入痒痒熊格式 json 文件**，感谢痒痒熊作者 @fluxxu 的技术支持；\n\n+ **导入时自动过滤四星以下和15级以下的御魂**，因为这部分御魂参与计算意义不大，并且会增加计算时间。\n\n###### 体验优化\n+ 单个御魂数值展示卡片中，**对非六星御魂标明了星级**，方便分辨查找；\n\n+ 收藏御魂套装时，支持重命名御魂套装名称。\n\n###### 问题修复\n+ 修复计算结果页面中，四五星御魂主属性数值显示与六星御魂一致的bug。\n\n"},{v:1.2,time:"2019-04-02",content:"紧急修复一个可能导致漏算的bug，感谢玩家发现有异常后发送json数据给我测试。\n\n这次可能漏算的组合为六个相同类型御魂的组合，对大家造成的不便表示万分抱歉！"},{v:1.1,time:"2019-04-02",content:'+ 计算指标增加"攻击"，用于计算高攻击御魂，适用针女、鸩等；\n\n+ 计算指标增加"生命"，用于计算高生命御魂，适用书翁等；\n\n+ 增加更新内容弹窗。当有新功能更新时将在用户刷新页面时提示，提示只会提示一次；\n\n+ 增加更新日志页面。在右上角，可查看历史更新日志。\n\n+ 兼容浏览器支持，现在部分非chrome浏览器也可以导入，不过推荐还是使用chrome最为稳妥。'},{v:1,time:"2019-04-01",content:"+ 初始版本发布。"}]}}]);